import React from 'react';
import { useFetch } from './hooks';

const PORT = 6287;

let baseUrl = `http://127.0.0.1:${PORT}/get_stocks_data?stocks=["${'AAPL'}"]&startDate=${'2019-01-01'}&endDate=${'2020-01-01'}`;

function Joke() {
  const { message, data, metaData } = useFetch(baseUrl, {});
  return (
    <div>
      <h3>Joke of the session</h3>
      <p><em>{message}</em></p>
        <p>{data.map((x) => x)}</p>
    </div>
  )
}

export default Joke;
